import React from 'react'

const AlertBox = (a) => {
    alert(a)
}

const Arrow_Fun = () => {

    return (
        <div>
            <button type="button" class="btn btn-outline-primary mt-3" onClick={AlertBox.bind(this, "ok")}>Arrow Fun Btn</button>
        </div>
    )
}

export default Arrow_Fun;
